import React, {Component} from "react";
import {Container, Row} from "reactstrap";
import Card from "./Card";

class GitDescription extends Component {
  constructor(props) {
    super(props);
    this.state = {
      cli: [
        {
          title: "git init",
          usage: "git init [repository name]",
          description: "This command is used to start a new repository.",
          cli: "git init",
          id: '1'
        },
        {
          title: "git clone",
          usage: "git clone [url] ",
          description: "This command is used to obtain a repository from an existing URL.",
          cli: "git clone",
          id: '2'
        },
        {
          title: "git add",
          usage: "git add [file]",
          description: "This command adds a file to the staging area.",
          cli: "git add",
          id: '3'
        }
      ]
    };
  }
  render() {
    return (
      <div className="container-fluid git-card">
        <div className="row">
          {this.state.cli.map((gitCli, i) => ( <Card key={i} gitCli={gitCli} /> ))}
      </div>
    </div>
  );
 }
}

export default GitDescription;
